import './App.scss';
import List from '@components/list';


function App() {

  const items = [
    "elementos",
    "de",
    "la",
    "lista",
  ]


  return (
    <div className="App">
      <List items={items} getter={(i:string)=>i}/>
    </div>
  );
}

export default App;
